import React, { useContext } from 'react';
import StarWarContext from '../context/StarWarContext';
// import { requestAPIAxios, requestAPI } from '../service/requestAPI';

export default function Table() {
  const { data } = useContext(StarWarContext);

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Rotation Period</th>
          <th>Orbital Priod</th>
          <th>Diameter</th>
          <th>Climate</th>
          <th>Gravity</th>
          <th>Terrain</th>
          <th>Surface Water</th>
          <th>Population</th>
          <th>Films</th>
          <th>Created</th>
        </tr>
      </thead>
      <tbody>
        {
          data.map((qq) => (
            <tr key={ qq.id }>
              <td>{ qq.name }</td>
              <td>{ qq.name }</td>
              <td>{ qq.name }</td>
              <td>{ qq.name }</td>
              <td>{ qq.name }</td>
              <td>{ qq.species }</td>
              <td>{ qq.gender }</td>
              <td>{ qq.status }</td>
              <td>{ qq.episode.length }</td>
            </tr>
          ))
        }
      </tbody>
    </table>
  );
}
